void process(
    SampleValue ** inputs,
    Index numInputs,
    SampleValue ** outputs,
    Index numOutputs,
    Index n
) {
    this->vs = n;
    this->updateTime(this->getEngine()->getCurrentTime());
    SampleValue * out1 = (numOutputs >= 1 && outputs[0] ? outputs[0] : this->dummyBuffer);
    SampleValue * out2 = (numOutputs >= 2 && outputs[1] ? outputs[1] : this->dummyBuffer);
    SampleValue * in1 = (numInputs >= 1 && inputs[0] ? inputs[0] : this->zeroBuffer);
    SampleValue * in2 = (numInputs >= 2 && inputs[1] ? inputs[1] : this->zeroBuffer);
    this->dspexpr_103_perform(in1, this->dspexpr_103_in2, this->signals[0], n);
    this->dspexpr_102_perform(this->dspexpr_102_in1, this->dspexpr_102_in2, this->dummyBuffer, n);
    this->dspexpr_105_perform(in2, this->dspexpr_105_in2, this->signals[1], n);

    this->p_20_perform(
        this->zeroBuffer,
        this->zeroBuffer,
        this->dummyBuffer,
        this->dummyBuffer,
        n
    );

    this->feedbackreader_03_perform(this->signals[2], n);
    this->signalsend_01_perform(this->signals[2], this->signals[3], n);
    this->signalreceive_01_perform(this->signals[3], this->signals[2], n);
    this->dspexpr_106_perform(in1, this->signals[2], this->signals[3], n);
    this->feedbackreader_04_perform(this->signals[2], n);
    this->signalsend_02_perform(this->signals[2], this->signals[4], n);
    this->signalreceive_02_perform(this->signals[4], this->signals[2], n);
    this->dspexpr_107_perform(in2, this->signals[2], this->signals[4], n);

    this->gen_02_perform(
        this->signals[3],
        this->signals[4],
        this->gen_02_attack,
        this->gen_02_lookahead,
        this->gen_02_release,
        this->gen_02_threshold,
        this->signals[2],
        this->signals[5],
        this->dummyBuffer,
        n
    );

    this->p_19_perform(this->signals[2], this->signals[5], this->signals[4], this->signals[3], n);
    this->dspexpr_101_perform(this->signals[0], this->signals[4], this->signals[5], n);
    this->p_24_perform(this->signals[4], this->signals[3], this->signals[0], this->signals[2], n);
    this->p_21_perform(this->signals[0], this->signals[2], this->signals[6], this->signals[7], n);
    this->p_23_perform(this->signals[6], this->signals[7], this->signals[2], this->signals[0], n);
    this->p_22_perform(this->signals[2], this->signals[0], this->signals[8], this->signals[9], n);
    this->feedbackwriter_03_perform(this->signals[8], n);
    this->feedbackwriter_04_perform(this->signals[9], n);
    this->dspexpr_104_perform(this->signals[1], this->signals[3], this->signals[9], n);
    this->p_16_perform(this->signals[5], this->signals[9], this->signals[1], this->signals[8], n);

    this->p_18_perform(
        this->signals[1],
        this->signals[8],
        this->signals[4],
        this->signals[3],
        this->signals[6],
        this->signals[7],
        this->signals[9],
        this->signals[5],
        n
    );

    this->gen_01_perform(
        this->signals[9],
        this->signals[5],
        this->gen_01_release,
        this->gen_01_lookahead,
        this->gen_01_attack,
        this->gen_01_threshold,
        this->signals[7],
        this->signals[6],
        this->dummyBuffer,
        n
    );

    this->p_17_perform(in1, in2, this->signals[7], this->signals[6], out1, out2, n);
    this->stackprotect_perform(n);
    this->globaltransport_advance();
    this->audioProcessSampleCount += this->vs;
}

void prepareToProcess(number sampleRate, Index maxBlockSize, bool force) {
    if (this->maxvs < maxBlockSize || !this->didAllocateSignals) {
        Index i;

        for (i = 0; i < 10; i++) {
            this->signals[i] = resizeSignal(this->signals[i], this->maxvs, maxBlockSize);
        }

        this->feedbacktilde_03_feedbackbuffer = resizeSignal(this->feedbacktilde_03_feedbackbuffer, this->maxvs, maxBlockSize);
        this->feedbacktilde_04_feedbackbuffer = resizeSignal(this->feedbacktilde_04_feedbackbuffer, this->maxvs, maxBlockSize);
        this->globaltransport_tempo = resizeSignal(this->globaltransport_tempo, this->maxvs, maxBlockSize);
        this->globaltransport_state = resizeSignal(this->globaltransport_state, this->maxvs, maxBlockSize);
        this->zeroBuffer = resizeSignal(this->zeroBuffer, this->maxvs, maxBlockSize);
        this->dummyBuffer = resizeSignal(this->dummyBuffer, this->maxvs, maxBlockSize);
        this->didAllocateSignals = true;
    }

    const bool sampleRateChanged = sampleRate != this->sr;
    const bool maxvsChanged = maxBlockSize != this->maxvs;
    const bool forceDSPSetup = sampleRateChanged || maxvsChanged || force;

    if (sampleRateChanged || maxvsChanged) {
        this->vs = maxBlockSize;
        this->maxvs = maxBlockSize;
        this->sr = sampleRate;
        this->invsr = 1 / sampleRate;
    }

    this->gen_02_dspsetup(forceDSPSetup);
    this->gen_01_dspsetup(forceDSPSetup);
    this->globaltransport_dspsetup(forceDSPSetup);
    this->p_16->prepareToProcess(sampleRate, maxBlockSize, force);
    this->p_17->prepareToProcess(sampleRate, maxBlockSize, force);
    this->p_18->prepareToProcess(sampleRate, maxBlockSize, force);
    this->p_19->prepareToProcess(sampleRate, maxBlockSize, force);
    this->p_20->prepareToProcess(sampleRate, maxBlockSize, force);
    this->p_21->prepareToProcess(sampleRate, maxBlockSize, force);
    this->p_22->prepareToProcess(sampleRate, maxBlockSize, force);
    this->p_23->prepareToProcess(sampleRate, maxBlockSize, force);
    this->p_24->prepareToProcess(sampleRate, maxBlockSize, force);

    if (sampleRateChanged)
        this->onSampleRateChanged(sampleRate);
}

